import React, { useEffect, useState } from 'react';

const Matchmaking = () => {
  const [matches, setMatches] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5000/api/matchmaking/USER_ID')
      .then(res => res.json())
      .then(data => setMatches(data))
      .catch(err => console.error(err));
  }, []);

  return (
    <div>
      <h1>Suggested Teammates</h1>
      <ul>
        {matches.map((user, i) => (
          <li key={i}>{user.username} - {user.rank}</li>
        ))}
      </ul>
    </div>
  );
};

export default Matchmaking;
